      "summary": "If you have around <b>15 minutes</b> to spend in the kitchen, Halloumi, Blueberry & Spinach Salad might be a great <b>gluten free</b> recipe to try. One serving contains <b>500 calories</b>, <b>28g of protein</b>, and <b>38g of fat</b>. For <b>$6.28 per serving</b>, you get a main course that serves 2. 1 person has made this recipe and would make it again. It is brought to you by Foodista. If you have lime juice, blueberries, slaw dressing, and a few other ingredients on hand, you can make it. With a spoonacular <b>score of 47%</b>, this dish is good. Try <a href=\"https://spoonacular.com/recipes/stuffed-aubergines-with-spinach-rice-and-halloumi-884333\">Stuffed aubergines with spinach rice and halloumi</a>, <a href=\"https://spoonacular.com/recipes/baby-spinach-halloumi-and-glazed-butternut-squash-19629\">Baby Spinach, Halloumi And Glazed Butternut Squash</a>, and <a href=\"https://spoonacular.com/recipes/spinach-and-feta-chicken-burgers-aka-spanakopita-burgers-with-grilled-halloumi-roasted-red-peppers-and-a-spinach-and-feta-sauce-611532\">Spinach and Feta Chicken Burgers (aka Spanakopita Burgers) with Grilled Halloumi, Roasted Red Peppers and a Spinach and Feta Sauce</a> for similar recipes.",
