      "summary": "You can never have too many side dish recipes, so give Golden Chickpeas With Cilantro, Garlic, Sun-Dried Tomatoes and Goat Cheese a try. For <b>$1.42 per serving</b>, this recipe <b>covers 15%</b> of your daily requirements of vitamins and minerals. One serving contains <b>384 calories</b>, <b>10g of protein</b>, and <b>26g of fat</b>. Only a few people made this recipe, and 1 would say it hit the spot. A mixture of have a stick of butter, a chickpeas, goat cheese, and a handful of other ingredients are all it takes to make this recipe so delicious. It is a good option if you're following a <b>gluten free and vegetarian</b> diet. From preparation to the plate, this recipe takes about <b>45 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 43%</b>. This score is good. Try <a href=\"https://spoonacular.com/recipes/sun-dried-tomato-goat-cheese-frittata-928647\">Sun-Dried Tomato Goat Cheese Frittata</a>, <a href=\"https://spoonacular.com/recipes/spinach-quiche-with-sun-dried-tomatoes-923350\">Spinach Quiche with Sun-Dried Tomatoes</a>, and <a href=\"https://spoonacular.com/recipes/garlic-cilantro-pesto-sauce-with-sun-dried-tomatoes-80586\">Garlic-cilantro Pesto Sauce With Sun-dried Tomatoes</a> for similar recipes.",
