      "summary": "Slow Cooked Corned Beef and Cabbage could be just the <b>gluten free and dairy free</b> recipe you've been looking for. This recipe makes 10 servings with <b>385 calories</b>, <b>25g of protein</b>, and <b>21g of fat</b> each. For <b>$2.17 per serving</b>, this recipe <b>covers 32%</b> of your daily requirements of vitamins and minerals. A mixture of bay leaves, onions, potatoes, and a handful of other ingredients are all it takes to make this recipe so scrumptious. A few people made this recipe, and 33 would say it hit the spot. It works well as a budget friendly main course. From preparation to the plate, this recipe takes approximately <b>8 hours and 20 minutes</b>. It will be a hit at your <b>st. patrick day</b> event. This recipe is typical of European cuisine. It is brought to you by Foodista. Taking all factors into account, this recipe <b>earns a spoonacular score of 99%</b>, which is excellent. <a href=\"https://spoonacular.com/recipes/slow-cooked-corned-beef-and-cabbage-93151\">Slow Cooked Corned Beef and Cabbage</a>, <a href=\"https://spoonacular.com/recipes/slow-cooked-corned-beef-378244\">Slow-Cooked Corned Beef</a>, and <a href=\"https://spoonacular.com/recipes/slow-cooked-corned-beef-dinner-165331\">Slow-Cooked Corned Beef Dinner</a> are very similar to this recipe.",
